   "source": [
    "**Fitting a Logistic model in R**\n",
    "A step by step guide"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "c6c44b8b",
   "metadata": {
    "papermill": {
     "duration": 0.003908,
     "end_time": "2023-05-26T15:23:40.314373",
     "exception": false,
     "start_time": "2023-05-26T15:23:40.310465",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "1. let's generate some dummy data to demonstrate the steps of fitting a logistic regression model in R and plotting the results."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 1,
   "id": "af28ebea",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2023-05-26T15:23:40.326672Z",
     "iopub.status.busy": "2023-05-26T15:23:40.324489Z",
     "iopub.status.idle": "2023-05-26T15:23:40.463419Z",
     "shell.execute_reply": "2023-05-26T15:23:40.461449Z"
    },
    "papermill": {
     "duration": 0.147586,
     "end_time": "2023-05-26T15:23:40.465993",
     "exception": false,
     "start_time": "2023-05-26T15:23:40.318407",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "# Generate dummy data\n",
    "set.seed(123)  # Set a seed for reproducibility\n",
    "\n",
    "# Create independent variable X\n",
    "X <- rnorm(100)\n",
    "\n",
    "# Create dependent variable Y\n",
    "logit <- -1 + 0.5 * X  # True coefficients\n",
    "Y <- rbinom(100, size = 1, prob = plogis(logit))  # Generate binary response variable\n"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "141ae7a7",
   "metadata": {
    "papermill": {
     "duration": 0.004257,
     "end_time": "2023-05-26T15:23:40.474618",
     "exception": false,
     "start_time": "2023-05-26T15:23:40.470361",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "2.Now lets fit the model to our data"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 2,
   "id": "c169a2d4",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2023-05-26T15:23:40.521751Z",
     "iopub.status.busy": "2023-05-26T15:23:40.484532Z",
     "iopub.status.idle": "2023-05-26T15:23:40.547534Z",
     "shell.execute_reply": "2023-05-26T15:23:40.541750Z"
    },
    "papermill": {
     "duration": 0.071575,
     "end_time": "2023-05-26T15:23:40.550266",
     "exception": false,
     "start_time": "2023-05-26T15:23:40.478691",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "# Fit the logistic regression model\n",
    "model <- glm(Y ~ X, family = binomial)\n"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "febec6ee",
   "metadata": {
    "papermill": {
     "duration": 0.004058,
