    "# Plot the data and the logistic regression curve\n",
    "plot(X, Y, xlim = range(X), ylim = c(0, 1), xlab = \"X\", ylab = \"Y\")\n",
    "points(X, predictions, col = \"red\", pch = 16)\n",
    "# Add the logistic regression curve to the plot\n",
    "curve(plogis(coef(model)[1] + coef(model)[2] * x), add = TRUE, col = \"blue\", lwd = 2)\n",
    "# Add a legend and customize the plot\n",
    "legend(\"topright\", legend = c(\"Observed\", \"Predicted\", \"Logistic Regression\"),\n",
    "       col = c(\"black\", \"red\", \"blue\"), pch = c(1, 16, NA), lwd = c(NA, NA, 2))\n",
    "title(\"Logistic Regression\")\n",
    "\n"
   ]
